import React from "react";

const Navbar = () => {
    return (
        <div style={{ backgroundColor: "#333", padding: "10px" }}>
            <ul style={{ color: "white" }}>
                <li><a href="default.asp">Home</a></li>
                <li><a href="news.asp">News</a></li>
                <li><a href="contact.asp">Contact</a></li>
            </ul>

        </div>
    );
};

export default Navbar;
